import { Tab, TabList, TabPanel, TabPanels, Tabs } from "@chakra-ui/tabs";
import React from "react";
import Layout from "../components/layout";

const schedule = ({ games }) => {
  console.log({ games });
  return (
    <Layout>
      <Tabs variant="solid-rounded" isFitted size="sm" colorScheme="gray">
        <TabList>
          <Tab>Bombers DI</Tab>
          <Tab>Bombers DIII</Tab>
          <Tab>Coaches & Staff</Tab>
        </TabList>
        <TabPanels>
          <TabPanel>{/* <PlayerList list={d1}></PlayerList> */}</TabPanel>
          <TabPanel>{/* <PlayerList list={d3}></PlayerList> */}</TabPanel>
          <TabPanel>
            {/* <PlayerList list={staff} staff></PlayerList> */}
          </TabPanel>
        </TabPanels>
      </Tabs>
    </Layout>
  );
};

export default schedule;
